import { Container } from "react-bootstrap";

export default function Login() {
  return (
    <Container style={{ marginLeft: "10%" }}>
    <form className="form">
      <h3>Login</h3>
      <input type="email" placeholder="Email" />
      <input type="password" placeholder="Password" />
      <button>Login</button>
    </form>
    </Container>
  );
}
